import { Link } from 'react-router-dom';
import * as React from 'react';
import Stack from '@mui/material/Stack';
// import Button from '@material-ui/core/Button';
import '../index.css';



const StartPage = () => {
  return (
    <header>
        <h1>
            Welcome to the Highlighting Extraction UI
        </h1>

        <Stack spacing={2}>
          <button classname='startPageButton' component={Link} to="/instructions">
            Instructions
          </button>
          
          <button classname='startPageButton' component={Link} to="/guidedAnnotation">
            Guided Annotation
          </button>

          <button classname='startPageButton' component={Link} to="/annotation">
            Annotation
          </button>
        </Stack>
    </header>
  )
}

export default StartPage
